import { Outlet } from 'react-router-dom';
import './Movies.css';

const Movies = () => {
  return (
    <div className="movies-page-container">
      <h1 className="movies-title">Movie Page</h1>
      <Outlet />
    </div>
  );
};

export default Movies;
